import styled from "styled-components";


export const Conteudo = styled.div`
display:flex;
width:100%;
height:50px;
`;

export const Cabeçario = styled.nav`
    display:flex;
    width:80%;
    height:50px;
    flex-direction:row;
    align-items:center;
    justify-content:flex-end;
  ul{
    padding:50px;
  }  
`;

export const Lista = styled.li `
    width:50%;
    background-color:#000;
`;
